import React, { useState,useEffect } from 'react';
import api from '../services/api';

import './styles.ts';

export default function Logon() {
  const [user, setUser] = useState();

  useEffect(() => {
    api
      .get()
      .then((response) => setUser(response.data))
      .catch((err) => {
        console.error("ops! ocorreu um erro" + err);
      });
  }, []);
  return (
    <>
      <h1>
        <div className='card'>
          {user?.quote}
        </div>
      </h1>
    </>
  );
}
